import { React, useState, useEffect } from 'react';
import { CountdownCircleTimer } from "react-countdown-circle-timer";

const PlayerStatus=()=>{

    return (
    <CountdownCircleTimer
    style={{
        position:"absolute",
        Top:"500px",
        Right:"1000px"}}
    isPlaying={true}
    strokeWidth={3}
    duration={30}
    size={70}
    colors={["#004777", "#F7B801", "#A30000", "#A30000"]}
    colorsTime={[10, 6, 3, 0]}>
    </CountdownCircleTimer>

)

}
export default PlayerStatus
